import React from "react";
import {Link  } from "react-router-dom";
export default function Turler() {
  return (
    <div style={{
        width:"1000px",
        height:"500px",
        display: "inline-block",
    }}>
        <Link to={`/tur/cavalier-king-charles-spaniel`}>
            <b>Cavalier King Charles Spaniel</b>
          </Link><br/>
          <Link to={`/tur/golden-retriever`}>
            <b>/tur/golden-retriever</b>
          </Link><br/>
          <Link to={`/tur/chihuahua`}>
            <b>/tur/chihuahua</b>
          </Link><br/>
          <Link to={`/tur/shepherd`}>
            <b>/tur/shepherd</b>
          </Link><br/>
          <Link to={`/tur/others`}>
            <b>/tur/others</b>
          </Link><br/>

          <hr/>
            <Link to={`/`}><h6>Return Homepage</h6></Link>
    </div>
  );
}
